import React, { useState, useEffect } from "react";
import { useLocation } from "react-router-dom";
import styled from "styled-components";
import axios from "axios";
import Products from "../components/Products";

const Container = styled.div`
  padding: 20px;
`;

const Title = styled.h1`
  margin: 20px;
  text-align: center;
  text-transform: capitalize;
  font-size: 2.5rem;
  font-weight: 300;
  color: #2d3748;
  position: relative;
  
  &::after {
    content: '';
    display: block;
    width: 80px;
    height: 3px;
    background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
    margin: 15px auto;
    border-radius: 2px;
  }
`;

const FilterContainer = styled.div`
  display: flex;
  justify-content: space-between;
  margin: 20px;
  flex-wrap: wrap;
  gap: 15px;
`;

const Filter = styled.div`
  display: flex;
  align-items: center;
  gap: 15px;
  flex-wrap: wrap;
`;

const FilterText = styled.span`
  font-size: 18px;
  font-weight: 600;
  color: #2d3748;
`;

const Select = styled.select`
  padding: 10px 15px;
  border: 2px solid #e2e8f0;
  border-radius: 8px;
  font-size: 14px;
  background: white;
  min-width: 140px;
  transition: all 0.3s ease;
  
  &:focus {
    outline: none;
    border-color: #4299e1;
    box-shadow: 0 0 0 3px rgba(66, 153, 225, 0.1);
  }
  
  &:hover {
    border-color: #cbd5e0;
  }
`;

const Option = styled.option`
  padding: 10px;
`;

const Loading = styled.div`
  text-align: center;
  padding: 80px 20px;
  color: #718096;
  font-size: 1.1rem;
  
  i {
    font-size: 2rem;
    margin-bottom: 15px;
    display: block;
  }
`;

const ProductList = () => {
  const location = useLocation();
  const category = location.pathname.split("/")[2]; // Gets 'men', 'women', 'accessories', 'shoes'
  const [products, setProducts] = useState([]);
  const [filteredProducts, setFilteredProducts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [filters, setFilters] = useState({
    size: "",
    color: ""
  });

  // Fetch all products from your backend
  useEffect(() => {
    const fetchProducts = async () => {
      try {
        setLoading(true);
        const response = await axios.get(`${process.env.REACT_APP_API_URL}/api/products`);
        setProducts(response.data);
      } catch (error) {
        console.error("Error fetching products:", error);
      } finally {
        setLoading(false);
      }
    };
    fetchProducts();
  }, []);

  // Filter products based on category
  useEffect(() => {
    if (products.length === 0) return;

    let filtered = products.filter((product) => {
      // If no category selected or 'all', show all products
      if (!category || category === "all") return true;

      // Use the existing categories array from your product data
      switch(category) {
        case "men":
          return product.categories.includes("men's clothing");
        case "women":
          return product.categories.includes("jewelery") ||
                 product.categories.includes("women's");
        case "accessories":
          return product.categories.includes("electronics") || 
                 product.categories.includes("jewelery");
        case "shoes":
          // Will automatically show shoes when you add products with "shoes" category
          return product.categories.includes("shoes");
        default:
          return false; // Changed to false for unknown categories
      }
    });

    // Apply additional filters (size, color)
    if (filters.size) {
      filtered = filtered.filter(product => 
        product.size.includes(filters.size)
      );
    }

    if (filters.color) {
      filtered = filtered.filter(product => 
        product.color.includes(filters.color)
      );
    }

    setFilteredProducts(filtered);
  }, [products, category, filters]);

  const handleFilters = (e) => {
    const value = e.target.value;
    setFilters({
      ...filters,
      [e.target.name]: value,
    });
  };

  if (loading) {
    return (
      <Container>
        <Loading>
          <i className="fas fa-spinner fa-spin"></i>
          Loading amazing products...
        </Loading>
      </Container>
    );
  }

  return (
    <Container>
      <Title>{category ? `${category} Products` : "All Products"}</Title>
      
      <FilterContainer>
        <Filter>
          <FilterText>Filter Products:</FilterText>
          <Select name="size" onChange={handleFilters} value={filters.size}>
            <Option value="">All Sizes</Option>
            <Option value="S">Small (S)</Option>
            <Option value="M">Medium (M)</Option>
            <Option value="L">Large (L)</Option>
            <Option value="XL">XL</Option>
            <Option value="XXL">XXL</Option>
            <Option value="One Size">One Size</Option>
          </Select>
          
          <Select name="color" onChange={handleFilters} value={filters.color}>
            <Option value="">All Colors</Option>
            <Option value="black">Black</Option>
            <Option value="white">White</Option>
            <Option value="blue">Blue</Option>
            <Option value="red">Red</Option>
            <Option value="navy">Navy</Option>
            <Option value="gray">Gray</Option>
            <Option value="gold">Gold</Option>
            <Option value="silver">Silver</Option>
            <Option value="rose gold">Rose Gold</Option>
            <Option value="white gold">White Gold</Option>
            <Option value="yellow gold">Yellow Gold</Option>
          </Select>
        </Filter>
      </FilterContainer>

      {/* Use the Products component instead of manual mapping */}
      <Products products={filteredProducts} loading={false} />
    </Container>
  );
};

export default ProductList;
